import React, { useEffect, useState } from "react";
import axios from 'axios'
function Home() {
    const [data, setData]= useState([])
    useEffect(()=>{
        axios.get('http://http://localhost:8081/')
        .then(res => setData(res.data))
        .catch(err=> console.log(err));
    },[])
    return(
     <div>
        <div>
            <table>
                <tbody>
                    <tr>
                        <th>ID</th>
                        <th>Name</th>
                        <th>Email</th>
                        <th>Action</th>
                    </tr>
                </tbody>
            </table>
        </div>
     </div> 
    )
}

export default Home
